INSERT INTO `video` VALUES (797, 'wangliang', '单老说健康', '如果嘴唇苍白，可能存在体内气血不足、贫血、营养不良、脾胃功能低下等问题；如果口角溃烂，可能是脾胃过热所致。\n治疗方法：规则饮食，细嚼慢咽，这是保养好脾胃的第一步，同时还要忌辛辣，多吃薏仁、茯苓、粳米煮的粥，有健脾养胃之效。\n鼻部毛孔粗大、发油，显示身体肺胃湿热；健肺气功：晚餐1-2小时后，先慢走10-15分钟，然后找一处环境安静、相对开阔的地方，站定后全身放松，两眼徐徐向前平视，双足迈开与肩同宽，双掌相搭掌心向上，放于肚脐下3公分左右的位置，吸气时收腹，再缓缓呼气放松。如此练习半小时，对健肺很有帮助   \n肝开窍于目”，也是说眼睛的健康与肝脏密切相关，治疗方法：养肝，饭后闭目30分钟,\n  中医讲：“肾开窍于耳”，耳垂提拉法,用食指拇指扣住耳垂，由内向外对耳垂进行提拉，手法上避免用力过重，时间控制在3-5分钟即可。这对改善头痛，头昏，神经衰弱及耳鸣都是很有效果的。#热门养生健康知识 #健康养生 #健康 #健康知识 #健康养生的知识', '2019-07-11', '/picture/1562815817749.jpg', '/video/1562815817749.mp4', 1);
